import React, { useState } from "react";
import "./AuthCard.css";

const logoUrl = "/logo192.png"; // Use your logo path

function PasswordStrength({ value }) {
  // Simple strength logic
  let strength = 0;
  if (value.length >= 8) strength++;
  if (/[A-Z]/.test(value)) strength++;
  if (/[0-9]/.test(value)) strength++;
  if (/[^A-Za-z0-9]/.test(value)) strength++;
  let label = ["Weak", "Fair", "Good", "Strong"][strength] || "Very Weak";
  let color = ["#ef4444", "#f59e42", "#3b82f6", "#8b5cf6"][strength] || "#ef4444";
  return (
    <div className="password-strength" style={{ color }}>
      {label}
    </div>
  );
}

export default function AuthCard({ onLogin, onRegister, error }) {
  const [tab, setTab] = useState("login");
  const [login, setLogin] = useState({ email: "", password: "", remember: false });
  const [register, setRegister] = useState({ name: "", email: "", password: "", confirm: "" });
  const [capsLock, setCapsLock] = useState(false);
  const [fieldErrors, setFieldErrors] = useState({});

  // Inline validation
  function validateLogin() {
    const errors = {};
    if (!login.email.match(/^[^@]+@[^@]+\.[^@]+$/)) errors.email = "Enter a valid email.";
    if (!login.password) errors.password = "Password required.";
    return errors;
  }
  function validateRegister() {
    const errors = {};
    if (!register.name.trim()) errors.name = "Name required.";
    if (!register.email.match(/^[^@]+@[^@]+\.[^@]+$/)) errors.email = "Enter a valid email.";
    if (register.password.length < 8) errors.password = "At least 8 characters.";
    if (register.password !== register.confirm) errors.confirm = "Passwords do not match.";
    return errors;
  }

  function handleCaps(e) {
    setCapsLock(e.getModifierState && e.getModifierState("CapsLock"));
  }

  function handleLogin(e) {
    e.preventDefault();
    const errors = validateLogin();
    setFieldErrors(errors);
    if (Object.keys(errors).length === 0 && onLogin) onLogin(login);
  }
  function handleRegister(e) {
    e.preventDefault();
    const errors = validateRegister();
    setFieldErrors(errors);
    if (Object.keys(errors).length === 0 && onRegister) onRegister(register);
  }

  return (
    <div className="auth-bg">
      <div className="auth-card">
        <div className="auth-header">
          <img src={logoUrl} alt="PeerX logo" className="auth-logo" />
          <h2 className="auth-title">PeerX</h2>
          <div className="auth-subtitle">Decentralized Cloud with End‑to‑End Encryption</div>
        </div>
        <div className="auth-tabs">
          <button className={tab === "login" ? "active" : ""} onClick={() => setTab("login")}>Login</button>
          <button className={tab === "register" ? "active" : ""} onClick={() => setTab("register")}>Register</button>
        </div>
        <div className="auth-content">
          {tab === "login" ? (
            <form onSubmit={handleLogin}>
              <div className="form-group">
                <label>Email</label>
                <input type="email" autoComplete="username" value={login.email} onChange={e => setLogin({ ...login, email: e.target.value })} />
                {fieldErrors.email && <div className="error-msg">{fieldErrors.email}</div>}
              </div>
              <div className="form-group">
                <label>Password</label>
                <input type="password" autoComplete="current-password" value={login.password} onChange={e => setLogin({ ...login, password: e.target.value })} onKeyUp={handleCaps} />
                {fieldErrors.password && <div className="error-msg">{fieldErrors.password}</div>}
                {capsLock && <div className="caps-warning">Caps Lock is ON</div>}
              </div>
              <div className="form-row">
                <label className="remember-me">
                  <input type="checkbox" checked={login.remember} onChange={e => setLogin({ ...login, remember: e.target.checked })} /> Remember me
                </label>
                <button type="button" className="forgot-btn">Forgot password?</button>
              </div>
              <button type="submit" className="primary-btn gradient">Login</button>
            </form>
          ) : (
            <form onSubmit={handleRegister}>
              <div className="form-group">
                <label>Name</label>
                <input type="text" autoComplete="name" value={register.name} onChange={e => setRegister({ ...register, name: e.target.value })} />
                {fieldErrors.name && <div className="error-msg">{fieldErrors.name}</div>}
              </div>
              <div className="form-group">
                <label>Email</label>
                <input type="email" autoComplete="email" value={register.email} onChange={e => setRegister({ ...register, email: e.target.value })} />
                {fieldErrors.email && <div className="error-msg">{fieldErrors.email}</div>}
              </div>
              <div className="form-group">
                <label>Password</label>
                <input type="password" autoComplete="new-password" value={register.password} onChange={e => setRegister({ ...register, password: e.target.value })} onKeyUp={handleCaps} />
                <PasswordStrength value={register.password} />
                <div className="helper-text">Min 8 chars, use upper/lowercase, number, symbol</div>
                {fieldErrors.password && <div className="error-msg">{fieldErrors.password}</div>}
                {capsLock && <div className="caps-warning">Caps Lock is ON</div>}
              </div>
              <div className="form-group">
                <label>Confirm Password</label>
                <input type="password" autoComplete="new-password" value={register.confirm} onChange={e => setRegister({ ...register, confirm: e.target.value })} />
                {fieldErrors.confirm && <div className="error-msg">{fieldErrors.confirm}</div>}
              </div>
              <button type="submit" className="primary-btn gradient">Register</button>
            </form>
          )}
          <div className="divider"><span>or</span></div>
          <div className="social-auth">
            <button className="social-btn google"><span className="icon-google" /> Continue with Google</button>
            <button className="social-btn github"><span className="icon-github" /> Continue with GitHub</button>
          </div>
        </div>
      </div>
    </div>
  );
}
